rulesList.cssText:
@layer utilities {
  .absolute { position: absolute; }
  .fixed { position: fixed; }
  .relative { position: relative; }
  .static { position: static; }
  .sticky { position: sticky; }
  .inset-0 { inset: calc(var(--spacing)*0); }
  .top-0 { top: calc(var(--spacing)*0); }
  .top-\[10px\] { top: 10px; }
  .top-\[16px\] { top: 16px; }
  .right-0 { right: calc(var(--spacing)*0); }
  .right-\[10px\] { right: 10px; }
  .right-\[16px\] { right: 16px; }
  .bottom-0 { bottom: calc(var(--spacing)*0); }
  .bottom-\[calc\(100\%\+8px\)\] { bottom: calc(100% + 8px); }
  .left-0 { left: calc(var(--spacing)*0); }
  .left-0\.5 { left: calc(var(--spacing)*.5); }
  .left-\[-99999px\] { left: -99999px; }
  .z-10 { z-index: 10; }
  .z-50 { z-index: 50; }
  .z-\[1\] { z-index: 1; }
  .z-\[1000\] { z-index: 1000; }
  .order-1 { order: 1; }
  .col-span-1 { grid-column: span 1 / span 1; }
  .\!m-0 { margin: calc(var(--spacing)*0) !important; }
  .m-0 { margin: calc(var(--spacing)*0); }
  .m-\[24px\] { margin: 24px; }
  .m-auto { margin: auto; }
  .mx-auto { margin-inline: auto; }
  .my-auto { margin-block: auto; }
  .mt-2 { margin-top: calc(var(--spacing)*2); }
  .mt-\[120px\] { margin-top: 120px; }
  .mb-0 { margin-bottom: calc(var(--spacing)*0); }
  .mb-2 { margin-bottom: calc(var(--spacing)*2); }
  .mb-4 { margin-bottom: calc(var(--spacing)*4); }
  .mb-8 { margin-bottom: calc(var(--spacing)*8); }
  .mb-10 { margin-bottom: calc(var(--spacing)*10); }
  .ml-\[10px\] { margin-left: 10px; }
  .block { display: block; }
  .flex { display: flex; }
  .grid { display: grid; }
  .hidden { display: none; ...

